import React,{useContext} from 'react'
import {Link} from 'react-router-dom'
import {DataContext} from '../context'
export default function Product() {

    const product = useContext(DataContext);

    return (
        <div id = "product">
            {
                product.map()
            }
        </div>
    )
}
